const Footer = () =>{
    return(
        <footer>
            <a href="https://linkedin.com" target="#">Linkedin</a>
            <a href="https://facebook.com" target="#">Facebook</a>
            <a href="https://youtube.com" target="#">Youtube</a>
            <a href="https://google.com" target="#">Google</a>
        </footer>
    )   
}

export default Footer;
